import "./App.css";
import WaterVending from "./Component/WaterVendingMachine";
function App() {
  return (
    <>
      <WaterVending />
      <div style={{ color: "red" }}>
        <div className="ScreenVending">A1</div>
        <div className="KeyVending">
          <button>A</button>
          <button>B</button>
          <button>C</button>
          <button>1</button>
          <button>2</button>
          <button>3</button>
        </div>
      </div>
    </>
  );
}

export default App;
